    data: |
      SELECT DISTINCT + + col1 FROM tab1 (FORMAT parquet) AS cor0 WHERE NOT col0 NOT BETWEEN + + col1 AND ( col2 ) + col2 * col0;
  - name: tab1

outputs:
  - name: q12528.out
    data: |
      14
      47
      5
